import init, { Chess } from "../wasm/chess_wasm.js"

export class ChessWasm {
  constructor() {
    init().then(() => {
      this.chess = new Chess('rnbqkbnr/pppppppp/8/8/4P3/8/PPPP1PPP/RNBQKBNR b KQkq e3 0 1');
    })
  }

  *fen() {
    this.chess;
  }
}
